import App from 'next/app';
import { StoreProvider, useStoreActions } from 'easy-peasy';
import store from '../store';

function MyApp({ Component, pageProps, user }) {
  if (user) {
    store.getActions().user.setUser(user);
  }

  return (
    <StoreProvider store={store}>
      <Component {...pageProps} />
    </StoreProvider>
  );
}
